import React, { Component } from 'react';
import './Checkout.css';
class Checkout extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div>
                <h2>Shopping Cart</h2>
                <div className="clearBoth"></div>
                <div className="items">
                    
                </div>
                <div className="summary">
                    <div><p>Order Summary</p></div>
                    
                    <div className="image">
                        <img src="/Images/1.jpg" />
                    </div>
                     <div className="otherData">
                         <div>
                            <a href="">Honeywell - Protective cover - for air conditioner - black</a>
                         </div>
                         <div className="inputsPrice">
                            <span>$29.99</span>
                            <span><input type="text" placeholder="1" /></span>

                         </div>
                     </div>
                </div>
            </div>
        )
    }
}
export default Checkout;
